export const COLUMNS = [
    {
        Header: 'ID',
        accessor: 'id'
    },
    {
        Header: 'Gallons Requested',
        accessor: 'gallons_requested'
    },
    {
        Header: 'Delivery Address',
        accessor: 'delivery_address'
    },
    {
        Header: 'Delivery Date',
        accessor: 'delivery_date'
    },
    {
        Header: 'Price(/gal)',
        accessor: 'price_per_gallon'
    },
    {
        Header: 'Amount Due',
        accessor: 'amount_due'
    }
]
